requires-python = ">=3.12"
resolution-markers = [
    "platform_system == 'Darwin' and sys_platform != 'linux'",
    "platform_machine == 'aarch64' and platform_system == 'Linux' and sys_platform != 'linux'",
    "(platform_machine != 'aarch64' and platform_system != 'Darwin' and sys_platform != 'linux') or (platform_system != 'Darwin' and platform_system != 'Linux' and sys_platform != 'linux')",
    "platform_system == 'Darwin' and sys_platform == 'linux'",
    "platform_machine == 'aarch64' and platform_system == 'Linux' and sys_platform == 'linux'",
    "(platform_machine != 'aarch64' and platform_system != 'Darwin' and sys_platform == 'linux') or (platform_system != 'Darwin' and platform_system != 'Linux' and sys_platform == 'linux')",
]

